import React from 'react';
import { TextField } from '@mui/material';

const TitleInput = ({ value, onChange }) => {
  return (
    <TextField
      label="Title"
      value={value}
      onChange={onChange}
      fullWidth
    />
  );
};

export default TitleInput;
